import React, { useState } from "react";
import './SuperEvent.css';

const eventsData = [
  { name: "Media Expo", date: "01/05/27", venue: "Hyderabad", status: "Pending" },
  { name: "Print Expo Chennai", date: "TBD", venue: "Chennai", status: "Pending" }
];

function EventOrganizers() {
  const [selectedMenu, setSelectedMenu] = useState("Event Status"); // Default to Event Status
  const [events, setEvents] = useState(eventsData);
  const [searchQuery, setSearchQuery] = useState("");

  const handleStatusChange = (index, newStatus) => {
    const updatedEvents = events.map((event, i) =>
      i === index ? { ...event, status: newStatus } : event
    );
    setEvents(updatedEvents);
  };

  const handleSearch = (e) => {
    setSearchQuery(e.target.value);
  };

  const filteredEvents = events.filter(event =>
    event.name.toLowerCase().includes(searchQuery.toLowerCase())
  );

  return (
    <div className="app-container">
      <Sidebar setSelectedMenu={setSelectedMenu} selectedMenu={selectedMenu} />
      <main className="main-content">
        <div className="header">
          <div className="dashboard-title">Dashboard</div>
          <div className="search-section">
            <input type="text" className="search-bar" placeholder="Search" onChange={handleSearch} />
            <button className="search-icon">🔍</button>
          </div>
          <div className="notifications">🔔</div>
        </div>


        <div className="event-organizers">
          <h3>Event Status</h3>
          <h4>Events</h4>
          <div className="form-group">
            <label>Name</label>
            <input type="text" />
          </div>
          <div className="form-group">
            <label>Venue</label>
            <input type="text" />
          </div>
          <div className="form-group">
            <label>Description</label>
            <input type="text"  />
          </div>
          <div className="form-group">
            <label>Date</label>
            <input type="text" />
          </div>
          <button className="update-btn">Update Changes</button>
        </div>
      </main>
    </div>
  );
}

const Sidebar = ({ setSelectedMenu, selectedMenu }) => {
  const menuItems = [
    { label: "Overview", key: "Overview" },
    { label: "Event Organizers", key: "Event Organizers" },
    { label: "Event Status", key: "Event Status" },
    { label: "Registrations", key: "Registrations" },
    { label: "Forms", key: "Forms" },
    { label: "Account", key: "Account" },
    { label: "Settings", key: "Settings" }
  ];

  return (
    <div className="sidebar">
      <div className="profile">
        <div className="avatar">👤</div>
        <div className="profile-name">Super Admin</div>
      </div>
      <nav className="menu">
        <ul>
          {menuItems.map((item) => (
            <li
              key={item.key}
              className={selectedMenu === item.key ? "active" : ""}
              onClick={() => setSelectedMenu(item.key)}
            >
              {item.label}
            </li>
          ))}
        </ul>
      </nav>
      <footer className="footer">Powered by Angniot Events</footer>
    </div>
  );
};

export default EventOrganizers;
